import * as React from 'react';
import Button from '@mui/material/Button';
import { Box } from '@mui/material';
//import { useState , useEffect } from 'react';
import Paper from '@mui/material/Paper';
import { IconButton, Typography } from '@mui/material';
import LooksOneIcon from '@mui/icons-material/LooksOne';
import DeleteIcon from '@mui/icons-material/Delete';
import { useTheme } from '@mui/material/styles';
import LooksTwoIcon from '@mui/icons-material/LooksTwo';
import Looks3Icon from '@mui/icons-material/Looks3';
import Looks4Icon from '@mui/icons-material/Looks4';
import Accordion from '@mui/material/Accordion';
import AccordionDetails from '@mui/material/AccordionDetails';
import AccordionSummary from '@mui/material/AccordionSummary';

function Settings() {
  const theme = useTheme();
  const [expanded, setExpanded] = React.useState(false);

  const handleChange = (panel) => (event, isExpanded) => {
    setExpanded(isExpanded ? panel : true);
  };

  return (
    <Box  >
      <Accordion sx={{}}  expanded={expanded === 'panel1'} onChange={handleChange('panel1')} >
        <AccordionSummary 
          expandIcon={<Button  variant="contained" disableElevation sx={{ ml:"10px"}} style={{backgroundColor:"white" , color:"orange"}}>إظهار</Button>}
          aria-controls="panel1bh-content"
          id="panel1bh-header"
        >
          <Typography sx={{ width: '33%', flexShrink: 0 }}>
            General settings
          </Typography>
          <Typography sx={{ color: 'text.secondary' }}>I am an accordion</Typography>
        </AccordionSummary>

        <AccordionDetails>

          <Typography>
            Nulla facilisi. Phasellus sollicitudin nulla et quam mattis feugiat.
            Aliquam eget maximus est, id dignissim quam.
          </Typography>

        </AccordionDetails>
        <IconButton 
      sx={{position:"absolute"  , right:"0" }}
      >
        <LooksOneIcon  />

      </IconButton>
      </Accordion>
      
    <Button variant="contained" disableElevation sx={{ml:130 , mb:2}} style={{backgroundColor:"orange" , color:"white"}}>
      أضف حصة
    </Button>

    <Paper  
  
  expanded={expanded === 'panel1'} onChange={handleChange('panel1')}
    sx={{
      position:"relative",
      width:"940px",
      display:"flex",
      justifyContent:"space-between",
      mt:"1px",
      mb:"10px",
      pt:"15px",
      pb:"7px",
      //width: {xs:"340px",sm:"340px",md:"340px"},
      mr:{xs:"200px"},
      ml:{sm:"200px"}
    }}
    style={{backgroundColor:theme.palette.roma.main}}
   >
    <AccordionSummary 
          expandIcon={<Button  variant="contained" disableElevation sx={{ ml:"10px"}} style={{backgroundColor:"white" , color:"orange"}}>إظهار</Button>}
          aria-controls="panel1bh-content"
          id="panel1bh-header"
        >
          <Typography sx={{ width: '33%', flexShrink: 0 }}>
            General settings
          </Typography>
          <Typography sx={{ color: 'text.secondary' }}>I am an accordion</Typography>
        </AccordionSummary>

